import zlib 
import base64
obf=""

reversed_data = obf[::-1]

# Step 2: Decode from base64
decoded_data = base64.b64decode(reversed_data)

# Step 3: Decompress using zlib
decompressed_code = zlib.decompress(decoded_data)

# Step 4: Print the source code instead of executing it
print(decompressed_code.decode())